const ContactDialog = (props) => {
  const { setIsContactDialogOpe, contactDialogRef } = props;

  return (
    isContactDialogOpen && (
      <dialog ref={contactDialogRef} className="lg:w-2/3 w-full p-10 rounded-lg backdrop:bg-black backdrop:opacity-50">
        <div className="w-100 flex justify-between">
          Contact Data
          <button onClick={() => setIsContactDialogOpen(false)} className="bg-gray py-1 px-2 rounded-lg">
            Close
          </button>
        </div>
      </dialog>
    )
  );
};

export default ContactDialog;
